const game = @import("main.zig");
const std = @import("std");

const ItemPattern = enum {
    slalom_l,
    slalom_r,
    circle_cw_0,
    circle_cw_90,
    circle_cw_180,
    circle_cw_270,
    circle_ccw_0,
    circle_ccw_90,
    circle_ccw_180,
    circle_ccw_270,
    semicircle_cw_0,
    semicircle_cw_90,
    semicircle_cw_180,
    semicircle_cw_270,
    semicircle_ccw_0,
    semicircle_ccw_90,
    semicircle_ccw_180,
    semicircle_ccw_270,
    diagonal_l_r,
    diagonal_r_l,
    diagonal_b_t,
    diagonal_t_b,
    diagonal_bl_tr,
    diagonal_tl_br,
    diagonal_tr_bl,
    diagonal_br_tl,
};

const ItemSpawn = struct {
    kind: game.ItemKind,
    pattern: ItemPattern,
    count: usize,
    dist: f32,
    mod: f32,
};

fn bakeItems(comptime spawns: []const ItemSpawn, comptime seed: u32) []const game.Item {
    comptime var items: []const game.Item = &.{};
    comptime var spawn_y = 0.2;
    comptime var rand_seed = seed;
    for (spawns) |spawn| {
        comptime var i: usize = 0;
        while (i < spawn.count) : (i += 1) {
            items = items ++ [_]game.Item{bakeItem(spawn, spawn_y, i, &rand_seed)};
            spawn_y += spawn.dist;
        }
    }

    return items;
}

fn bakeItem(spawn: ItemSpawn, spawn_y: f32, item_index: usize, rand_seed: *u32) game.Item {
    var item: game.Item = undefined;
    item.kind = spawn.kind;
    item.y = spawn_y;
    switch (spawn.pattern) {
        .slalom_l => bakeItemSlalom(rand_seed, &item, item_index, spawn.mod, true),
        .slalom_r => bakeItemSlalom(rand_seed, &item, item_index, spawn.mod, false),
        .circle_cw_0 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 0, std.math.tau, true),
        .circle_cw_90 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi / 2.0, std.math.tau, true),
        .circle_cw_180 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi, std.math.tau, true),
        .circle_cw_270 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 3.0 * std.math.pi / 2.0, std.math.tau, true),
        .circle_ccw_0 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 0, std.math.tau, false),
        .circle_ccw_90 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi / 2.0, std.math.tau, false),
        .circle_ccw_180 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi, std.math.tau, false),
        .circle_ccw_270 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 3.0 * std.math.pi / 2.0, std.math.tau, false),
        .semicircle_cw_0 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 0, std.math.pi, true),
        .semicircle_cw_90 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi / 2.0, std.math.pi, true),
        .semicircle_cw_180 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi, std.math.pi, true),
        .semicircle_cw_270 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 3.0 * std.math.pi / 2.0, std.math.pi, true),
        .semicircle_ccw_0 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 0, std.math.pi, false),
        .semicircle_ccw_90 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi / 2.0, std.math.pi, false),
        .semicircle_ccw_180 => bakeItemCircle(spawn, &item, item_index, spawn.mod, std.math.pi, std.math.pi, false),
        .semicircle_ccw_270 => bakeItemCircle(spawn, &item, item_index, spawn.mod, 3.0 * std.math.pi / 2.0, std.math.pi, false),
        .diagonal_l_r => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, -1.0, 0.0, 1.0, 0.0),
        .diagonal_r_l => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, 1.0, 0.0, -1.0, 0.0),
        .diagonal_b_t => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, 0.0, 1.0, 0.0, -1.0),
        .diagonal_t_b => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, 0.0, -1.0, 0.0, 1.0),
        .diagonal_bl_tr => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, -1.0, 1.0, 1.0, -1.0),
        .diagonal_tl_br => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, -1.0, -1.0, 1.0, 1.0),
        .diagonal_tr_bl => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, 1.0, -1.0, -1.0, 1.0),
        .diagonal_br_tl => bakeItemDiagonal(spawn, &item, item_index, spawn.mod, 1.0, 1.0, -1.0, -1.0),
    }
    return item;
}

fn bakeItemSlalom(rand_seed: *u32, item: *game.Item, item_index: usize, mod: f32, start_left: bool) void {
    var side = @intToFloat(f32, item_index % 2) * 2.0 - 1.0;
    if (start_left) {
        side *= -1.0;
    }

    item.x = rand(rand_seed) * mod * side;
    item.h = rand(rand_seed) * mod * side;
}

fn bakeItemCircle(spawn: ItemSpawn, item: *game.Item, item_index: usize, mod: f32, start_angle: f32, len: f32, cw: bool) void {
    const end_angle = if (cw) start_angle + len else start_angle - len;
    const ratio = @intToFloat(f32, item_index) / @intToFloat(f32, spawn.count);
    const angle = ratio * (end_angle - start_angle) + start_angle;
    item.x = @cos(angle) * mod;
    item.h = @sin(angle) * mod;
}

fn bakeItemDiagonal(spawn: ItemSpawn, item: *game.Item, item_index: usize, mod: f32, l: f32, b: f32, r: f32, t: f32) void {
    const ratio = @intToFloat(f32, item_index) / @intToFloat(f32, spawn.count);
    const ll = l * mod;
    const bb = b * mod;
    const rr = r * mod;
    const tt = t * mod;
    item.x = ratio * (rr - ll) + ll;
    item.h = ratio * (bb - tt) + tt;
}

fn rand(rand_seed: *u32) f32 {
    const rand_mul = 16807;
    const rand_mod = 2147483647;
    rand_seed.* = (rand_seed.* *% rand_mul) % rand_mod;
    return @intToFloat(f32, rand_seed.*) / @intToFloat(f32, rand_mod);
}

